import BookItem from "./BookItem.js"
import bookData from "../data/bookData.js"

import "./BookItem.css"

function Container() {

  return (
    <div className="container">
      {bookData.map(function(item, idx){
         return (
           <BookItem props={item}/>
         )
      })}
    </div>
  );
}

export default Container;
